import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';

// import Home from './components/Home';
import Companies from './Company/pages/Companies';

function App() {
  return <Router>
    <Route path="/">
      <Companies />
    </Route>
  </Router>;
}

export default App;
